// Imports
import Web3ContextProvider from "./context/Web3Context";
import { Routes, Route, Navigate } from "react-router";
import { lazy, Suspense } from "react";

// Components
import Navbar from "./components/Navbar";
import NotFound from "./components/NotFound";
import PageLoader from "./components/PageLoader";

// Styles
import "./styles/index.scss";


const Verify = lazy(() => import("./components/Verify"));
const Create = lazy(() => import("./components/Create"));
const Home = lazy(() => import("./components/Home"));
const Actions = lazy(() => import("./components/Actions"));

const App = () => {
	return (
		<Web3ContextProvider>
			<Navbar />
			<main>
									<Routes>
													<Route path="/">
																			<Route	exact path="create" element={<Suspense fallback={<PageLoader />}>
																						<Create />
																					</Suspense>
																				}
																			/>
																			<Route path="verify" element={<Suspense fallback={<PageLoader />}>
																						<Verify />
																					</Suspense>
																				}
																			/>
																			<Route exact path="/" element={<Suspense fallback={<PageLoader />}>
																							<Home />
																					</Suspense>
																				}
																			/>
																			<Route exact path="actions" element={<Suspense fallback={<PageLoader />}>
																						<Actions />
																					</Suspense>
																				}
																			/>
																			<Route exact path="404" element={<NotFound />} />

																			<Route path="*" element={<Navigate to="/404" />} />
													</Route>
									</Routes>
			</main>

			<footer>
            <div className="social"><link src="#"><i classNameName="icon ion-social-instagram"></i></link><link src="#"><i classNameName="icon ion-social-snapchat"></i></link><link src="#"><i className="icon ion-social-twitter"></i></link><link src="#"><i className="icon ion-social-facebook"></i></link></div>
														<ul className="list-inline">
																		<li className="list-inline-item"><link src="/">Home</link></li>
																		<li className="list-inline-item"><link src="/">Services</link></li>
																		<li className="list-inline-item"><link src="/">About</link></li>
																		<li className="list-inline-item"><link src="/">Terms</link></li>
																		<li className="list-inline-item"><link src="/">Privacy Policy</link></li>
														</ul>
            <p classNameName="copyright">Assetto Â© 2022</p>
        </footer>
		</Web3ContextProvider>
	);
};

export default App;
